import EmotionAnalyzer from "./component/EmotionAnalyzer";
import {Route, Switch} from "react-router-dom";
import React from "react";

function App() {
  return (
      <Switch>
        <Route path="/" exact component={EmotionAnalyzer} />
      </Switch>
  );
}

export default App;
